Denys Honcharenko worked on the McDonald's Global App (GMAL) as a Lead Android Engineer and KMM Developer from August 2021 to October 2022. The GMAL is the world's most downloaded food and beverage app, serving over 100 million users across 60+ countries. Denys was responsible for working on the MDS (Delivery) and Payments feature streams, implementing KMP shared libraries for both Android and iOS. He designed the architecture for over 20 payment providers and delivery integrations, led the ViewBinding migration, and established the gmal-lite-rc Slack channel for improved release processes.

The project showcased Denys' expertise in Kotlin, Kotlin Multiplatform (KMM), Jetpack Compose, and Coroutines. It also highlighted his ability to work on large-scale projects, lead teams, and drive technical innovation.

